class Crud extends Component {
  constructor(){
    super();


  }   




  render() {
    return (
    <div className="Crud">
      <div className="navbar navbar-ligth bg-primary">
        <a className="text-white" href="/App">Tennis App</a>
        <Link className="text-white mr-sm-2" To="/Home">Exit</Link>

      </div>
      <div className="container">
         <div className="col-md-6 m-5 ">
             <StudentForm/>


           </div>
           <div id="Students-list" className="col-md-12 mx-auto m-3">
           <StudentList/>
          </div> 

      </div>

    </div>
    );
  }
}

export default Crud;
